import React from 'react';
import { Button, Container, Nav, Navbar } from 'react-bootstrap';



const Header = () => {
    return (
      <Navbar style={{backgroundColor:"#AAADC3"}}>
        <Container>
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
          <Nav >
            <Nav.Link className='mx-2' href="#home">Home</Nav.Link>
            <Nav.Link className='mx-2' href="#features">Features</Nav.Link>
            <Nav.Link className='mx-2' href="#pricing">Seavices</Nav.Link>
            <Nav.Link className='mx-2' href="#pricing">Product</Nav.Link>
            <Nav.Link className='mx-2' href="#pricing">Testmonial</Nav.Link>
            <Nav.Link className='mx-2' href="#pricing">FAQ</Nav.Link>
          </Nav>
          <div>
            <Button className='mx-3'>Search</Button>
            <Button st >Search</Button>
          </div>
        </Container>
      </Navbar>
    );
}

export default Header;
